    "geo" : { },
    "id_str" : "958525837984305153",
    "text" : "This always makes me nuts. The president is not a magic god king whose spirit is bound to the land.  Or the Dow. The bounty of the harvest and the rate of GDP growth in any given year have, at best, a very small and very tenuous relationship to the occupant of the White House. https:\/\/t.co\/SbvmWrhhVn",
